John Bishop's Australia

Travel Documentary hosted by John Bishop, published by BBC in 2014 - English narration


Information
------------------------------

John Bishop's Australia
Series following John Bishop as he embarks on an Australian adventure, cycling from Sydney to Cairns. Along the way he meets extraordinary people and experiences some true natural wonders.


1)  Part 1 
The first in a three-part series following comedian John Bishop as he sets off on an Australian adventure, cycling from Sydney to Cairns. John first made this journey back in 1992, and in 2014 he is back to see how this incredible country has changed. Along the route John meets extraordinary people, hears fascinating stories and experiences some true natural wonders. In this episode, John tests his nerves with a death-defying abseil in the stunning Blue Mountains, gets hands-on with the most dangerous snakes on the planet, and finds out about the surprising bedtime habits of the most Australian animal of all: the koala.

2)  Part 2 
John kicks off the second episode in the beautiful beach town of Byron Bay. After attempting to surf (incredibly badly) and getting shown up by some super-fit Aussie kids, John heads further north towards Queensland. Across vast landscapes he encounters gigantic saltwater crocs, stunning desert islands, and experiences an Australia we at home do not normally see. In Wild West Rockhampton John goes cattle herding on horseback with the biggest beef baron in Australia, before getting a bit too close to the action at a full-blooded Queensland rodeo.

3)  Part 3 
In episode three John travels deep into tropical Australia. Pedalling through the heat and rain, John takes on a gruelling military fitness test, rides motorbikes with Vietnam veterans, and gets completely caked in mud while working on a banana farm. (It's harder than it looks apparently). As the trip reaches its conclusion John takes in the breathtaking natural beauty of both the Great Barrier Reef, and the Daintree Rainforest, before ending his incredible journey with a surprising personal twist.

